import { useForm } from "react-hook-form";
import logo from "../assets/images/Locker.png";
import WebService from "../utility/WebService";

const Login = () => {
    const dispatch: AppDispatch = useDispatch();
    const navigate = useNavigate();
    const {
        handleSubmit,
        register,
        formState: { errors },
    } = useForm();

    const Login = (data: any) => {
        if (!data) {
            alert("Please Enter Username and Password");
        } else {
            var url = "/ouath-token";
            WebService.getAccesstoken({
                action: url,
                body: data,
            })
                .then((res: any) => {
                    if (res && res.access_token) {
                        localStorage.setItem("token", res.access_token);
                        toast.success(res.message);
                        getLoginUserDetails();
                    }
                })
                .catch((error: any) => {
                    // setLoading(false);
                });
        }
    }

    const getLoginUserDetails = () => {
        WebService.getAPI({
            action: "/me",
        })
            .then((res: any) => {
                if (res && res.result) {
                    localStorage.setItem("UserData", JSON.stringify(res.result));
                    let data = res.result;
                    dispatch(loginUser({ data }))
                    navigate("/dashboard");
                    // setLoading(false);

                    // dispatch(userData(res.result));
                }
            })
            .catch((error: any) => {
                // toast.error(error);
                //   setLoading(false);
            });

    }

    return (
        <div className="auth-page-wrapper pt-5">
            <div className="auth-one-bg-position auth-one-bg" id="auth-particles">
                <div className="bg-overlay"></div>

                <div className="shape">
                    <svg xmlns="http://www.w3.org/2000/svg" version="1.1" viewBox="0 0 1440 120">
                        <path d="M 0,36 C 144,53.6 432,123.2 720,124 C 1008,124.8 1296,56.8 1440,40L1440 140L0 140z"></path>
                    </svg>
                </div>
            </div>

            {/* <!-- auth page content --> */}
            <div className="auth-page-content">
                <div className="container">
                    <div className="row">
                        <div className="col-lg-12">
                            <div className="text-center mt-sm-5 mb-4 text-white-50">
                                <div>
                                    <a href="index.html" className="d-inline-block auth-logo">
                                        <img src={logo} alt="" height="40" />
                                    </a>
                                </div>
                            </div>
                        </div>
                    </div>
                    {/* <!-- end row --> */}

                    <div className="row justify-content-center">
                        <div className="col-md-8 col-lg-6 col-xl-5">
                            <div className="card mt-4">
                                <div className="card-body p-4">
                                    <div className="text-center mt-2">
                                        <h5 className="text-primary">Welcome Back !</h5>
                                        <p className="text-muted">Sign in to continue to Locker.</p>
                                    </div>
                                    <div className="p-2 mt-4">
                                        <form >
                                            <div className="mb-3">
                                                <label htmlFor="email" className="form-label">UserEmail</label>
                                                <input
                                                    type="email"
                                                    {...register("email", { required: true })}
                                                    className="form-control shadow-lg"
                                                    id="emailInput"
                                                    placeholder="name@example.com"
                                                />
                                                {errors.email && <span className="text-danger">Email is required</span>}
                                            </div>

                                            <div className="mb-3">
                                                <div className="float-end">
                                                    <a href="auth-pass-reset-basic.html" className="text-muted">Forgot password?</a>
                                                </div>
                                                <label className="form-label" htmlFor="password-input">Password</label>
                                                <div className="position-relative auth-pass-inputgroup mb-3">
                                                    <div className="input-group">
                                                        <input
                                                            type="password"
                                                            {...register("password", { required: true })}
                                                            className="form-control shadow-lg"
                                                            id="passwordInput"
                                                            placeholder="Your Password"
                                                        />
                                                        {errors.password && <span className="text-danger">Password is required</span>}
                                                    </div>
                                                    <button
                                                        className="btn btn-link position-absolute end-0 top-0 text-decoration-none text-muted"
                                                        type="button"
                                                        id="password-addon">
                                                        {" "}
                                                        <i className="ri-eye-off-fill align-middle"></i>
                                                    </button>
                                                </div>
                                            </div>
                                            <div className="form-check">
                                                <input className="form-check-input" type="checkbox" value="" id="auth-remember-check" />
                                                <label className="form-check-label" htmlFor="auth-remember-check">Remember me</label>
                                            </div>
                                            <div className="mt-4">
                                                <button className="btn btn-success w-100" type="submit">Log In</button>
                                            </div>
                                        </form>
                                    </div>
                                </div>
                                {/* <!-- end card body --> */}
                            </div>
                            {/* <!-- end card --> */}

                            <div className="mt-4 text-center">
                                <p className="mb-0">Already have an account ? <a href="auth-signin-basic.html" className="fw-semibold text-primary text-decoration-underline"> Signin </a> </p>
                            </div>

                        </div>
                    </div>
                    {/* <!-- end row --> */}
                </div>
                {/* <!-- end container --> */}
            </div>
            {/* <!-- end auth page content --> */}
        </div>
    );
};

export default Login;
